import { Component } from "react";

class CardList extends Component {
  render() {
    console.log("render !!!");
    const { linuxHosts } = this.props;

    return (
      <div className="card-list">
        {linuxHosts.map((eachHost) => {
          return (
          <div className="card-container" key={eachHost.id}>
            <img
              alt={`host ${eachHost.name}`}
              src={`https://cdn-icons-png.flaticon.com/512/915/915974.png?w=360`}
              width={70}
            />
            <h2>{eachHost.name}</h2>
            <p>{eachHost.email}</p>
          </div>
        )})}
      </div>
    );
  }
}

export default CardList;
